import React from 'react';
import './Commands.css'
import { Card } from 'semantic-ui-react';
import commands from './Command';

function Commands() {
  return (
    <div className='Commands'>
      <Card.Group>
        {commands.map((({ header, description })))}
      </Card.Group>
    </div >
  );
}

export default Commands;
